% integrates order (2*N+1)
function [r s t w] = tet_cubature_TP(N)

[ra wa] = JacobiGQ(0,0,N);
[rb wb] = JacobiGQ(1,0,N);
[rc wc] = JacobiGQ(2,0,N);

[a b c] = meshgrid(ra, rb, rc);
[wa wb wc] = meshgrid(wa,wb,wc);

a = a(:); b = b(:); c = c(:);
wa = wa(:); wb = wb(:); wc = wc(:);
w = wa.*wb.*wc;
w = (4/3)*w/sum(w);

[r s t] = tet_abctorst(a,b,c);

